function About() {
  return (
    <div>
      <h1>Welcome to the About Us Page!</h1>
      <p>We are Almog and Eithan, and this is our final project for the Java workshop course.</p>
      <p>As proud parents to a charming and fat cat named Aslan, this topic is very close to our hearts.</p>
      <p>We hope you'll enjoy visiting our web app.</p>
      <p>If you have any questions, feel free to <a href="mailto:filavmooki@gmail.com">contact us</a>.</p>
    </div>
  );
}

export default About;
